In 2011, Michael Bublé covered the company's earnings call and promised to pay back $1.5 million in cash. But the company failed to pay back the $1 million, and the settlement didn't include a penalty.

In 2014, Michael Bublé sued Apple on behalf of eight of its former employees, alleging that it failed to adequately pay them for the following things:

• Employees' privacy;

• Employees' rights to privacy and security;

• Employees' right to due process;

• Employee's ability to file grievances with Apple and the court, and

• Employees' right to sue Apple and the court.

In September, the plaintiffs successfully won their case, but only in the U.S. Court of Appeals for the Fourth Circuit. In an opinion issued today, Chief Justice John Roberts wrote that the plaintiffs "were attempting to circumvent the [Justice Department's] requirement that a court 'have the authority to impose a penalty on a company for violations of a law which the court believes the company has violated.'"

As a result, the case was dismissed last year.

In February, the Fifth Circuit Court of Appeals overturned the trial judge's ruling.
